  `detection` smallint(3) NOT NULL default '-10',
  `detection_up_level` smallint(3) NOT NULL default '-10',
  `commonability` smallint(2) NOT NULL default '-10',
  `raceability` smallint(2) NOT NULL default '-10',
  PRIMARY KEY  (`id`)
);

